import React from 'react';
import { Box, Typography } from '@mui/material';
import QuestionButton from './QuestionButton';


const Question = () => {
    return (
        <Box>
            <Typography variant="h4">Question 1</Typography>
            <Typography variant="h6">What is the capital of France?</Typography>
            <QuestionButton >Paris</QuestionButton>
            <QuestionButton >London</QuestionButton>
            <QuestionButton >Berlin</QuestionButton>
            <QuestionButton >Madrid</QuestionButton>
        </Box>
    )
}

export default Question
